import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SignUp from '/Users/v450/myphysiotherapist/src/components/SignUp.js';
import Login from '/Users/v450/myphysiotherapist/src/components/LogIn.js';
import Logout from '/Users/v450/myphysiotherapist/src/components/LogOut.js';
import Dashboard from '/Users/v450/myphysiotherapist/src/components/Dashboard.js';
import ProtectedRoute from './auth/ProtectedRoute';
import History from '/Users/v450/myphysiotherapist/src/components/History.js';
import axios from 'axios';


const MY_ = process.env.my_API;
function App() {
  const [therapyHistory, setTherapyHistory] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchTherapyHistory = async () => {
      try {
        // Fetch therapy history data from an API or local storage
        const response = await axios.get(my_API);
        setTherapyHistory(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching therapy history:', error);
        setLoading(false);
      }
    };

    fetchTherapyHistory();
  }, []);

  return (
    <Router>
      <h1>Welcome to My Physiotherapist</h1>
      <p>My Physiotherapist is an app that can guide you through the basic rehabilitation process. 
        You can save your data of the exercises and days you finished in the history and keep track of your pain intensity over time.</p>

      <div>
        <nav>
          <ul>
            <li>
              <Link to="/signup">Sign Up</Link>
            </li>
            <li>
              <Link to="/login">Login</Link>
            </li>
            <li>
              <Link to="/logout">Logout</Link>
            </li>
            <li>
              <Link to="/history">History</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/signup" element={<SignUp />} />
          <Route path="/login" element={<Login />} />
          <Route path="/logout" element={<Logout />} />
          <Route path="/history" element={<History history={therapyHistory} loading={loading} />} />

          <Route 
            path="/dashboard" 
            element={
              <ProtectedRoute>
                <Dashboard />
              </ProtectedRoute>
            } 
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
